import React from 'react';
import $ from 'jQuery';

/*Navbar*/
jQuery(document).ready(function($){
    "use strict";
    var navclone=function(){
        $('.js-clone-nav').each(function(){
            var $this= $(this);
            $this.clone().attr('class','clone-view').appendTo('.mobile-view-body');
        });

        $('body').on('click','.js-toggle',function(e){
            var $this=$(this);
            e.preventDefault();
            if($('body').hasClass('off-view')){
               $('body').removeClass('off-view');
            }else{
               $('body').addClass('off-view');
            }
        });

        $(document).mouseup(function(e){
            var container=$('.mobile-view');
            if(!container.is(e.target) && container.has(e.target).length === 0){
               if($('body').hasClass('off-view')){
                   $('body').removeClass('off-view');
                }
            }
        });
         
         $(window).resize(function(){
             var $this=$(this),
             w=$this.width();
             if(w>768){
               if($('body').hasClass('off-view')){
                   $('body').removeClass('off-view');
                }
             }
         })



    }
    navclone();
});/*End of Navbar*/

function MainPage(){
    return(
        <div>
    <div class="page-wrap">
        <div class="nav-style">
            <div class="mobile-view">
              <div class="mobile-view-header">
                  <div class="mobile-view-close">
                  <i class="fa fa-times js-toggle"></i>
                </div>
              </div>
              <div class="mobile-view-body"></div>
            </div>
            <nav class="navbar navbar-expand-lg navbar-light bg-white fixed-top">
                <div class="container">
                    <a class="navbar-brand pl-0" href="#">
                        <img class="logo" src="images/logo.webp" alt="Novacept" title="Novacept"/>
                      </a>
                <div class="d-inline-block d-lg-none ml-md-0 ml-auto py-3"><i class="fa fa-bars js-toggle" aria-hidden="true"></i>
                </div>
                <div class="d-none d-lg-block">
                  <ul class="navbar-nav ml-auto js-clone-nav">
                    <li class="nav-item dropdown">
                        <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                          HOME
                        </a>
                        <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                          <a class="dropdown-item" href="#">About Us</a>
                          <a class="dropdown-item" href="#">Our Team</a>
                        </div>
                      </li>
                      <li class="nav-item dropdown">
                        <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                          PRODUCTS
                        </a>
                        <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                          <a class="dropdown-item" href="#">NovaGenie</a>
                          <a class="dropdown-item" href="#">Change Facilitator</a>
                          <a class="dropdown-item" href="#">Personal Facilitator</a>
                          <a class="dropdown-item" href="#">PROJECT Z</a>
                          <a class="dropdown-item" href="#">Talent 360</a>
                        </div>
                      </li>
                      <li class="nav-item dropdown">
                        <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                          SERVICES
                        </a>
                        <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                          <a class="dropdown-item" href="#">Workforce Enablement</a>
                          <a class="dropdown-item" href="#">Enterprise Agility</a>
                          <a class="dropdown-item" href="#">Actionable Analytics</a>
                          <a class="dropdown-item" href="#">Disruptive Innovation</a>
                        </div>
                      </li>
                      <li class="nav-item dropdown">
                        <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                          RESOURCES
                        </a>
                        <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                          <a class="dropdown-item" href="#">Blog</a>
                          <a class="dropdown-item" href="#">Business Use Cases</a>
                        </div>
                      </li>
                  </ul>
                </div>
            </div>
              </nav>
        </div>
    </div>
    <section>
        <img class="home" src="images/home-bg.webp" alt="Home Background Image"/>
        <img class="home-cover" src="images/home-cover-bg.webp" alt="Home Background Cover Image"/>
    <div class="col-lg-6 col-md-6 col-sm-6 home-section">
        <h1 class="home-heading">Thinking Forward</h1>
        <p class="home-text">We use technology to solve real world problems, helping organizations improve their day to day operations and give more focus to customer related activities.</p>
    </div>
    </section>
  
    <section class="our-products">
        <h2 class="products-heading">Our Products</h2>
        <div class="products-section">
           <ul class="product-list">
               <li class="product-list-1">NovaGenie</li>
               <li class="product-list-2">Change Facilitator</li>
               <li class="product-list-3">Personal Facilitator</li>
               <li class="product-list-4">ProjectZ</li>
               <li class="product-list-5">Talent 360</li>
           </ul>
        <div class="row prod-section">
           <div class="col-lg-6 col-md-12 col-sm-12 product-text-section">
                <h2 class="prod-heading">NovaGenie</h2>
                <p class="prod-text">Do you know that on any workday, your employees spend more than 40% of their time doing repetitive or mundane works which doesnâ€™t add value to the business or enrich their work experience? Well not anymore, offload your repetitive and mundane tasks to an AI virtual assistant and it will be done without manual intervention.</p>
           </div>
           <div class="col-lg-6 col-md-12 col-sm-12 product-text-section">
                <img class="prod-img" src="images/product-image.webp" alt="Product Image"/>
           </div>
        <div class="buttons">
           <button class="readmore">Read More</button>
           <button class="usecases">Use Cases</button>
        </div>
        </div>
        </div>
    </section>
        </div>
    );
}

export default MainPage;
